import React, { useState } from "react";
import Navbar from "./Navbar";
import Dashboard from "./Dashboard";
import Login from "./Login";

function App() {

 const [currentPage, setCurrentPage] = useState('Dashboard');

 return (
  <div>
    <Navbar setCurrentPage=''></Navbar>
    {
      () => {
        switch(currentPage){
          case 'Dashboard':
            return <Dashboard />;
          case 'Login':
            return <Login />; 
          default:
            return <Dashboard />; 
        };
      }
    }

  </div>
 );
};

export default App;
